    [],nt"revision_timestamp": "2015-09-27T03:02:06.149314",nt"name": "ais-ship-traffic-hawaii-2011-2012",nt"isopen":
    false,nt"url": null,nt"notes": "Ship position data from a satellite-based
    Automatic Identification System (AIS) were obtained jointly by PacIOOS (J. Potemra),
    SOEST/ORE of the University of Hawaii (E. Roth), and the Papahanaumokuakea Marine
    National Monument (PNMN) (D. Graham) through a one-time purchase from ORBCOMM LLC.
    The purchase agreement was made in late 2012 and was for a 30-by-30 degree section
    of historical AIS data that included the region of the Hawaiian Islands. The data
    include AIS long and unchecked reports for a one year period: August 2011 through
    mid-August 2012. The raw, monthly GPS files were locally converted to NetCDF for
    the PacIOOS data servers. Due to vendor constraints, release of the raw data is
    limited.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
